var apiKey = '4e98a09b8fe84f1589922ae73098b946';

var stationsCleaned = [];

function recursiveClean(i, callback) {
  var station = stations[i];
  delete station.stationUri;
  delete station.stationLines;
  for(var j = 0; j < station.stationExits.length; j++) {
    delete station.stationExits[j].nearby;
  }
  crossWithTrafikLab(station.stationName, function(result) {
      console.log(JSON.stringify(result));
      if(result.ResponseData) {
        if(result.ResponseData.length > 0) {
          station.stationID = result.ResponseData[0].SiteId;
          stationsCleaned.push(station);
        }
      }
      if(i == stations.length - 1) {
        return callback(stationsCleaned);
      }
      else {
        recursiveClean(i+1, callback);
      }
  });
}

function crossWithTrafikLab(key, callback) {
  key = encodeURIComponent(key);
  http.request({
      host: "api.sl.se",
      path: "/api2/typeahead.json?key="+apiKey+"&searchstring="+key+"&stationsonly="+true+"&maxresults=1"
    }, function(response) {
        // Continuously update stream with data
        var body = '';
        response.on('data', function(d) {
          body += d;
        });
        response.on('end', function() {
          var parsed = JSON.parse(body);
          return callback(parsed);
        });
      }

  ).end();
}

